import React, { Component } from "react";
import "./App.css";
import { Route, Link } from "react-router-dom";
import Home from "./Home/Home.js";
import Logos from "./Logo.png";

class App extends Component {
  render() {
    let url =
      "https://developer.nps.gov/api/v1/parks?parkCode=cane&api_key=y010UOulh2F9R7ahrlYpcyXUEJltY7vRei1uVxpe";
    fetch(url)
      .then(res => res.json())
      .then(res => {
        // console.log(res);
        let park = res.data[0];
        // console.log(park);
        console.log(park.images[0].url);
      });
    fetch(url);

    return (
      <div className="site">
        <nav>
          <Link to="/">
            <h1 className="topbar">National Parks List</h1>
          </Link>
        </nav>
        <main>
          <Route path="/" component={Home} />
        </main>
        <footer className="Footer">
          <img className="FooterLogo" src={Logos} />
        </footer>
      </div>
    );
  }
}

export default App;
